INSERT INTO `book` (`book_id`, `title`, `authors`, `quantity`, `price`, `description`, `image`, `image_name`) VALUES
('9780091929787', 'ReWork: Change the Way You Work Forever', 'David Heinemeier Hansson, Jason Fried', 13, 9.59, 'From the founders of the trailblazing software company 37signals, here is a different kind of business book - one that explores a new reality. Today, anyone can be in business. Tools that used to be out of reach are now easily accessible. Technology that cost thousands is now just a few pounds or even free. Stuff that was impossible just a few years ago is now simple. \r\n\r\nThat means anyone can start a business. And you can do it without working miserable 80-hour weeks or depleting your life savings. You can start it on the side while your day job provides all the cash flow you need. Forget about business plans, meetings, office space - you don''t need them.', , '41B0smyluvL._SX311_BO1,204,203,200_.jpg');
INSERT INTO `book` (`book_id`, `title`, `authors`, `quantity`, `price`, `description`, `image`, `image_name`) VALUES
('9780195321050', 'How to Read a Film', 'James Monaco', 0, 24.96, 'Richard Gilman referred to How to Read a Film as simply &quot;the best single work of its kind.&quot; And Janet Maslin in The New York Times Book Review marveled at James Monaco''s ability to collect &quot;an enormous amount of useful information and assemble it in an exhilaratingly simple and systematic way.&quot; Indeed, since its original publication in 1977, this hugely popular book has become the definitive source on film and media. Now, James Monaco offers a special anniversary edition of his classic work, featuring a new preface and several new sections, including an &quot;Essential Library: One Hundred Books About Film and Media You Should Read&quot; and &quot;One Hundred Films You Should See.&quot; As in previous editions, Monaco once again looks at film from many vantage points, as both art and craft, sensibility and science, tradition and technology. After examining film''s close relation to other narrative media such as the novel, painting, photography, television, and even music, the book discusses the elements necessary to understand how films convey meaning, and, more importantly, how we can best discern all that a film is attempting to communicate. In addition, Monaco stresses the still-evolving digital context of film throughout--one of the new sections looks at the untrustworthy nature of digital images and sound--and his chapter on multimedia brings media criticism into the twenty-first century with a thorough discussion of topics like virtual reality, cyberspace, and the proximity of both to film. With hundreds of illustrative black-and-white film stills and diagrams, How to Read a Film is an indispensable addition to the library of everyone who loves the cinema and wants to understand it better.', , '51zCN+aVGVL._SX348_BO1,204,203,200_.jpg');
INSERT INTO `book` (`book_id`, `title`, `authors`, `quantity`, `price`, `description`, `image`, `image_name`) VALUES
('9780596007300', 'Killer Game Programming in Java', 'Andrew Davison', 10, 29.99, 'A comprehensive guide has everything you need to program Java games. It offers the most thorough coverage of Java 3D available, and clearly details the older, better-known 2D APIs, 3D sprites, animated 3D sprites, first-person shooter programming, sound, fractals, and networked games. This practical book is a must-have for anyone who wants to create adrenaline-fueled games in Java.', , 'killerSmall.jpg');
INSERT INTO `book` (`book_id`, `title`, `authors`, `quantity`, `price`, `description`, `image`, `image_name`) VALUES
('9780714839370', 'The Photography Book', 'Ian Jeffrey, Phaidon Editors', 5, 7.95, 'When The Photography Book was first published in 1997 it was universally acclaimed as the most fundamental reference book ever on its subject. This new mini edition has all the visual energy and compelling insights of the original, but in a light and easily portable format, making it ideal both for dipping into and for using as a serious sourcebook.', , '5100NFxhhHL._SX429_BO1,204,203,200_.jpg');
INSERT INTO `book` (`book_id`, `title`, `authors`, `quantity`, `price`, `description`, `image`, `image_name`) VALUES
('9780857084163', 'Entrepreneur Revolution: How to develop your entrepreneurial mindset and start a business that works', 'Daniel Priestley', 5, 9.09, 'The world is embarking on a new age. The age of the entrepreneur, the agile small business owner, the flexible innovator. The days of the industrial age are over. It s time to break free from the industrial revolution mindâ€“set, quit working so hard, follow your dream and make a fortune along the way. The slow dinosaurs of the industrial age are being outpaced by fastâ€“moving startâ€“ups, ambitious small businesses and technological innovators. Entrepreneur Revolution is a master class in gaining an entrepreneurial mindâ€“set, showing you how to change the way you think, the way you network, and the way you make a living. Successful entrepreneur Daniel Priestley will show you how to embrace the Entrepreneur Revolution and thrive in the new age.', , '514mThfSjnL._SX318_BO1,204,203,200_.jpg');
INSERT INTO `book` (`book_id`, `title`, `authors`, `quantity`, `price`, `description`, `image`, `image_name`) VALUES
('9781444191004', 'Mathematics: A Complete Introduction', 'Hugh Neill', 25, 10.39, 'The book covers all areas of mathematics, and each chapter includes explanations and examples to help you learn the skills you need.', , '51QOU6QBDzL._SX328_BO1,204,203,200_.jpg');
INSERT INTO `book` (`book_id`, `title`, `authors`, `quantity`, `price`, `description`, `image`, `image_name`) VALUES
('9781491905012', 'Modern PHP: New Features and Good Practices', 'Josh Lockhart', 0, 19.99, 'Author Josh Lockhartâ€”creator of PHP The Right Way, a popular initiative to encourage PHP best practicesâ€”reveals these new language features in action. Youâ€™ll learn best practices for application architecture and planning, databases, security, testing, debugging, and deployment. If you have a basic understanding of PHP and want to bolster your skills, this is your book.', , '51fIuBswbgL._SX379_BO1,204,203,200_.jpg');
INSERT INTO `book` (`book_id`, `title`, `authors`, `quantity`, `price`, `description`, `image`, `image_name`) VALUES
('9781491933091', 'PHP Web Services: APIs for the Modern Web', 'Lorna Jane Mitchell', 3, 15.27, 'Whether youâ€™re sharing data between two internal systems or building an API so users can access their data, this practical book provides everything you need to build web service APIs with PHP. Author Lorna Jane Mitchell uses code samples, real-world examples, and advice based on her extensive experience to guide you through the processâ€”from the underlying theory to methods for making your service robust.', , '51AzlYsGMnL._SX379_BO1,204,203,200_.jpg');
INSERT INTO `book` (`book_id`, `title`, `authors`, `quantity`, `price`, `description`, `image`, `image_name`) VALUES
('9781533409928', 'German in a Week!', 'Language Guru', 2, 9.99, 'This book contains proven techniques and strategies to help self-learners acquire proficiency in the fundamentals of the German language in as little as one week.', , '51HbK8dQ1eL._SX331_BO1,204,203,200_.jpg');
INSERT INTO `book` (`book_id`, `title`, `authors`, `quantity`, `price`, `description`, `image`, `image_name`) VALUES
('9781781254172', 'Lingo: A Language Spotter''s Guide to Europe', 'Gaston Dorren, Jonathan Buckley, Alison Edwards', 15, 8.99, 'Welcome to Europe as you''ve never known it before, seen through the peculiarities of its languages and dialects. Combining linguistics and cultural history, Gaston Dorren takes us on an intriguing tour of the continent, from Proto-Indo-European (the common ancestor of most European languages) to the rise and rise of English, via the complexities of Welsh plurals and Czech pronunciation. Along the way we learn why Esperanto will never catch on, how the language of William the Conqueror lives on in the Channel Islands and why Finnish is the easiest European language.', , '51+initPmbL._SX324_BO1,204,203,200_.jpg');

